import React from 'react';
import logo from './logo.svg';
import './App.scss';
import './Global.scss';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} height="50px" width="50px" className=" App-logo" alt="logo" />
        <p>
          Title of our page is Huddle
        </p>
      </header>
    </div>
  );
}

export default App;
